import React, { useRef } from "react";
import Settings from './Settings';
import ShoppingBag from './ShoppingBag';
import { NavLink } from "react-router-dom";

const Header = () => {

    const btnTextRef_1 = useRef(null);
    const btnTextRef_2 = useRef(null);
    //const btnTextRef_3 = useRef(null);
   // const btnTextRef_4 = useRef(null);

    return (
        <div className="header">
            <div className="flex-container">
                <a href="/" className="logo">Art Supplies</a>
                <Settings btnTextRef_1={btnTextRef_1} btnTextRef_2={btnTextRef_2} s />
            </div>
            <nav>
                <ul className="navbar">
                    <li>
                        <NavLink to="/brushes">Brushes</NavLink>
                    </li>
                    <li>
                        <NavLink to="/paint">Paint</NavLink>
                    </li>
                    <li>
                        <NavLink to="/paper">Paper</NavLink>
                    </li>
                    <li>
                        <NavLink to="/pencils">Pencils</NavLink>
                    </li>
                </ul>
                <div className="btn-container">
                    <button className="menu-btn"><img src="icons/bars-solid.svg" alt="Menu Bars"></img><span ref={btnTextRef_1}>Menu</span></button>
                    <button className="header-btn"><img src="icons/bag-shopping-solid.svg" alt="Shopping Bag" className="icon"></img><span ref={btnTextRef_2}>Shopping Bag</span></button>
                </div>
            </nav>
        </div>
    )
}

export default Header;
